function checkConnection() {
	var qwx = navigator.connection.type;
	var label = '';
	switch (qwx) {
		case Connection.UNKNOWN:
			label = 'Unknown connection';
			break;
		case Connection.ETHERNET:
			label = 'Ethernet connection';
			break;
		case Connection.WIFI:
			label = 'WiFi connection';
			break;
		case Connection.CELL_2G:
			label = 'Cell 2G connection';
			break;
		case Connection.CELL_3G:
			label = 'Cell 3G connection';
			break;
		case Connection.CELL_4G:
			label = 'Cell 4G connection';
			break;
		case Connection.CELL:
			label = 'Cell generic connection';
			break;
		case (Connection.NONE):
			label = 'No network connection';
			break;
	}
	return {
		type: qwx,
		label: label,
		online: (qwx != Connection.NONE)
	};
}

